<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="utf-8" />
  <title>Interactive Mind-Map</title>
  <script src="https://unpkg.com/vis-network/standalone/umd/vis-network.min.js"></script>
  <style>
    html, body {
      width: 100%; height: 100%; margin: 0; padding: 0; overflow: hidden;
      font-family: 'Segoe UI', Roboto, Arial, sans-serif;
      background: #f8f9fa;
      display: flex;
      flex-direction: column;
    }
    .header {
      background: #2B7CE9; color: #fff; padding: 18px 32px;
      font-size: 1.7rem; font-weight: 600; text-align: left; letter-spacing: 1px;
      box-shadow: 0 2px 12px rgba(43,124,233,0.08);
      flex-shrink: 0;
    }
    .main-content {
      flex-grow: 1;
      position: relative;
    }
    .controls {
      position: absolute; top: 10px; left: 10px; z-index: 10;
      background: rgba(255, 255, 255, 0.95);
      padding: 14px 18px; border-radius: 12px; box-shadow: 0 4px 24px rgba(0,0,0,0.10);
      display: flex; gap: 12px; align-items: center; font-size: 15px;
    }
    .controls input, .controls select, .controls button {
      border: 1px solid #bfc9d1; padding: 8px; border-radius: 6px; font-size: 15px;
      background: #f6f8fa; cursor: pointer;
    }
    .popup { display:none; position:absolute; z-index:1000; min-width:260px; max-width:450px; background:#fff; border:1px solid #aaa; border-radius:8px; box-shadow:0 2px 12px rgba(0,0,0,0.18); padding:12px 16px; }
    .nav-controls { display: flex; gap: 4px; align-items: center; }
    .nav-btn { width: 32px; height: 32px; font-size: 18px; display: flex; align-items: center; justify-content: center; transition: background 0.2s; }
    .nav-btn:hover { background: #d0d7de; }
    #mynetwork {
      position: absolute; top: 0; left: 0; right: 0; bottom: 0;
      width: 100%; height: 100%;
    }
  </style>
</head>

<body>
  <div class="header">
    <span>Concept Mind Map</span>
  </div>
  <div class="main-content">
      <div class="controls">
        <!-- Concept Index -->
        <select id="concept-index" style="min-width:200px;"></select>
        <!-- Node Action Buttons -->
        <button id="show-papers-btn">Show Papers</button>
        <button id="find-source-btn">Find Sources</button>
        <!-- Depth Slider -->
        <label for="depth-slider">Depth:</label>
        <input type="range" min="1" max="5" value="1" id="depth-slider" style="width: 100px;">
        <span id="depth-value">1</span>
        <!-- Navigation -->
        <div class="nav-controls">
          <button class="nav-btn" id="pan-left" title="Pan Left">←</button>
          <button class="nav-btn" id="pan-up" title="Pan Up">↑</button>
          <button class="nav-btn" id="center-view" title="Center View">●</button>
          <button class="nav-btn" id="pan-down" title="Pan Down">↓</button>
          <button class="nav-btn" id="pan-right" title="Pan Right">→</button>
          <button class="nav-btn" id="zoom-in" title="Zoom In">+</button>
          <button class="nav-btn" id="zoom-out" title="Zoom Out">-</button>
        </div>
      </div>
      <!-- Popups -->
      <div id="papers-popup" class="popup"></div>
      <div id="sources-popup" class="popup"></div>
      <div id="mynetwork"></div>
  </div>

    const container = document.getElementById("mynetwork");
    const data = { nodes: nodesData, edges: edgesData };
    const options = {
      physics: {
        stabilization: { iterations: 1500 },
        enabled: true,
        barnesHut: { gravitationalConstant: -30000, centralGravity: 0.05, springLength: 350, avoidOverlap: 1.2 }
      },

      },

        scaling: { min: 15, max: 50 },
        color: { border: '#2B7CE9', background: '#97C2FC' }
      }
    };
    let network = new vis.Network(container, data, options);
    network.once('stabilizationIterationsDone', () => network.setOptions({ physics: false }));

    const conceptIndex = document.getElementById('concept-index');
    const depthSlider = document.getElementById('depth-slider');
    const depthValue = document.getElementById('depth-value');
    const papersPopup = document.getElementById('papers-popup');
    const sourcesPopup = document.getElementById('sources-popup');
    let lastSelectedNodeId = null;

    const visibleNodeColor = { border: '#2B7CE9', background: '#97C2FC' };
    const fadedNodeColor = { border: 'rgba(200, 200, 200, 0.05)', background: 'rgba(200, 200, 200, 0.05)' };
    const visibleEdgeColor = { color: 'rgba(132, 180, 232, 0.8)' };
    const fadedEdgeColor = { color: 'rgba(200, 200, 200, 0.05)' };
    const visibleFont = { color: '#343434' };
    const fadedFont = { color: 'rgba(150, 150, 150, 0.1)' };

    function populateConceptIndex() {
      const allNodesArray = nodesData.get({ fields: ['id', 'label'], order: 'label' });
      conceptIndex.innerHTML = '<option value="">Select a concept...</option>';
      allNodesArray.forEach(node => {
        const opt = document.createElement('option');
        opt.value = node.id;
        opt.textContent = node.label;
        conceptIndex.appendChild(opt);
      });
    }

    function hidePopups() {
        papersPopup.style.display = 'none';
        sourcesPopup.style.display = 'none';
    }

    function applyDepthFilter() {
        const nodesToUpdate = [];
        const edgesToUpdate = [];

        if (!lastSelectedNodeId) {
            // No node selected, make everything visible
            nodesData.getIds().forEach(id => nodesToUpdate.push({ id, color: visibleNodeColor, font: visibleFont }));
            edgesData.getIds().forEach(id => edgesToUpdate.push({ id, color: visibleEdgeColor, hidden: false }));
        } else {
            const maxDepth = parseInt(depthSlider.value, 10);
            const nodesToShow = new Set([lastSelectedNodeId]);
            const edgesToShow = new Set();
            let lastLevel = new Set([lastSelectedNodeId]);

            // Correct BFS traversal to find nodes and edges within depth
            for (let i = 0; i < maxDepth; i++) {
                let nextLevel = new Set();
                lastLevel.forEach(nodeId => {
                    const connectedEdges = network.getConnectedEdges(nodeId);
                    connectedEdges.forEach(edgeId => {
                        const edge = edgesData.get(edgeId);
                        const otherNodeId = (edge.from === nodeId) ? edge.to : edge.from;

                        edgesToShow.add(edgeId); // This edge is part of the path
                        if (!nodesToShow.has(otherNodeId)) {
                            nextLevel.add(otherNodeId);
                            nodesToShow.add(otherNodeId);
                        }
                    });
                });
                lastLevel = nextLevel;
                if (lastLevel.size === 0) break;
            }

            // Prepare batch updates for all nodes and edges
            nodesData.getIds().forEach(id => {
                nodesToUpdate.push({
                    id,
                    color: nodesToShow.has(id) ? visibleNodeColor : fadedNodeColor,
                    font: nodesToShow.has(id) ? visibleFont : fadedFont
                });
            });

            edgesData.getIds().forEach(id => {
                 edgesToUpdate.push({
                    id,
                    color: edgesToShow.has(id) ? visibleEdgeColor : fadedEdgeColor,
                    hidden: !edgesToShow.has(id) // Also hide edge to remove arrow
                });
            });
        }

        // Apply updates in a single batch for performance
        if (nodesToUpdate.length > 0) nodesData.update(nodesToUpdate);
        if (edgesToUpdate.length > 0) edgesData.update(edgesToUpdate);
    }

    document.getElementById('show-papers-btn').onclick = function(e) {
        if (!lastSelectedNodeId) return alert('Please select a concept first.');
        const docIds = clusterToDocs[lastSelectedNodeId];
        const node = nodesData.get(lastSelectedNodeId);

        if (!docIds || docIds.length === 0) return alert('No contributing papers found for this concept.');

        let html = `<b>Contributing Papers for "${node.label}":</b><ul style="padding-left:18px; margin: 8px 0;">`;
        docIds.forEach(docId => {
            const meta = docMetadata[docId];
            if (meta) html += `<li>${meta.title}</li>`;
        });
        html += '</ul><button onclick="hidePopups()">Close</button>';

        papersPopup.innerHTML = html;
        const btnRect = e.target.getBoundingClientRect();
        papersPopup.style.top = (btnRect.bottom + window.scrollY + 6) + 'px';
        papersPopup.style.left = (btnRect.left + window.scrollX) + 'px';
        papersPopup.style.display = 'block';
    };

    document.getElementById('find-source-btn').onclick = function(e) {
        if (!lastSelectedNodeId) return alert('Please select a concept first.');
        const docIds = clusterToDocs[lastSelectedNodeId];
        const node = nodesData.get(lastSelectedNodeId);

        if (!docIds || docIds.length === 0) return alert('No external sources found for this concept.');

        let html = `<b>Sources for "${node.label}":</b><ul style="padding-left:18px; margin: 8px 0;">`;
        docIds.forEach(docId => {
            const meta = docMetadata[docId];
            if(meta) {
                 html += `<li><a href="${meta.url}" target="_blank">${meta.title}</a> <span style='color:#888;'>[${meta.category}]</span></li>`;
            }
        });
        html += '</ul><button onclick="hidePopups()">Close</button>';

        sourcesPopup.innerHTML = html;
        const btnRect = e.target.getBoundingClientRect();
        sourcesPopup.style.top = (btnRect.bottom + window.scrollY + 6) + 'px';
        sourcesPopup.style.left = (btnRect.left + window.scrollX) + 'px';
        sourcesPopup.style.display = 'block';
    };

    conceptIndex.onchange = function() {
        const nodeIdStr = this.value;
        if (nodeIdStr) {
            lastSelectedNodeId = parseInt(nodeIdStr, 10);
            network.focus(lastSelectedNodeId, { scale: 1.2, animation: true });
            network.selectNodes([lastSelectedNodeId]);
        } else {
            network.selectNodes([]);
            lastSelectedNodeId = null;
        }
        hidePopups();
        applyDepthFilter();
    };

    depthSlider.oninput = function() {
        depthValue.textContent = this.value;
        if (lastSelectedNodeId) {
            applyDepthFilter();
        }
    };

    network.on('selectNode', function(params) {
        if (params.nodes.length > 0) {
            lastSelectedNodeId = params.nodes[0];
            conceptIndex.value = lastSelectedNodeId;
            hidePopups();
            applyDepthFilter();
        }
    });

    network.on('deselectNode', function() {
        lastSelectedNodeId = null;
        conceptIndex.value = "";
        hidePopups();
        applyDepthFilter();
    });

    document.getElementById('zoom-in').onclick = () => network.zoomIn();
    document.getElementById('zoom-out').onclick = () => network.zoomOut();
    document.getElementById('pan-up').onclick = () => network.moveNode(network.getViewPosition().x, network.getViewPosition().y - 100);
    document.getElementById('pan-down').onclick = () => network.moveNode(network.getViewPosition().x, network.getViewPosition().y + 100);
    document.getElementById('pan-left').onclick = () => network.moveNode(network.getViewPosition().x - 100, network.getViewPosition().y);
    document.getElementById('pan-right').onclick = () => network.moveNode(network.getViewPosition().x + 100, network.getViewPosition().y);
    document.getElementById('center-view').onclick = () => network.fit({ animation: true });

    populateConceptIndex();
  </script>
</body>
</html>
